import Footer from "./components/Footer/Footer";
import Header from "./Header";
import Section from "./components/Sections/Section";

function App() {
  return (
    <div className="App">
      <Header />
      <Header />
      <Section />
      <Footer />
    </div>
  );
}

export default App;
